import React, { useState, useEffect } from 'react';
import SpaceCard from '../components/SpaceCard';

const Home = ({ spaces, onFavorite, onReserve }) => {
  const [filteredSpaces, setFilteredSpaces] = useState([]);
  const [search, setSearch] = useState('');
  const [priceRange, setPriceRange] = useState([0, 300]);
  const [selectedType, setSelectedType] = useState('');
  const [currentPage, setCurrentPage] = useState(1);
  const [sortOrder, setSortOrder] = useState('');
  const [loading, setLoading] = useState(true);

  const itemsPerPage = 6;

  useEffect(() => {
    setTimeout(() => {
      setLoading(false);
    }, 500);
  }, []);

  useEffect(() => {
    let results = spaces.filter((space) => {
      const matchesSearch = space.name.toLowerCase().includes(search.toLowerCase());
      const matchesPrice = space.price >= priceRange[0] && space.price <= priceRange[1];
      const matchesType = selectedType ? space.type === selectedType : true;

      return matchesSearch && matchesPrice && matchesType;
    });

    if (sortOrder === 'price-asc') {
      results.sort((a, b) => a.price - b.price);
    } else if (sortOrder === 'price-desc') {
      results.sort((a, b) => b.price - a.price);
    } else if (sortOrder === 'name-asc') {
      results.sort((a, b) => a.name.localeCompare(b.name));
    }

    setFilteredSpaces(results);
    setCurrentPage(1);
  }, [spaces, search, priceRange, selectedType, sortOrder]);

  const paginatedSpaces = filteredSpaces.slice(
    (currentPage - 1) * itemsPerPage,
    currentPage * itemsPerPage
  );

  if (loading) {
    return (
      <div className="flex justify-center items-center min-h-screen">
        <p className="text-2xl font-bold text-gray-600">Cargando espacios...</p>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Search Section */}
      <div className="bg-orange-500 py-8">
        <div className="max-w-3xl mx-auto px-4">
          <div className="bg-white rounded-full shadow-lg flex items-center p-2">
            <input
              type="text"
              placeholder="Buscar garages por ubicaciÃ³n o nombre..."
              value={search}
              onChange={(e) => setSearch(e.target.value)}
              className="w-full px-4 py-2 outline-none"
            />
            <button className="bg-orange-500 text-white px-6 py-2 rounded-full hover:bg-orange-600">
              Buscar
            </button>
          </div>
        </div>
      </div>

      {/* Filters */}
      <div className="max-w-7xl mx-auto px-4 py-4">
        <div className="flex space-x-4 overflow-x-auto">
          <button className="flex items-center px-4 py-2 rounded-full border hover:bg-gray-50">Todos</button>
          <button
            onClick={() => setSelectedType('garage')}
            className="flex items-center px-4 py-2 rounded-full border hover:bg-gray-50"
          >
            Garages
          </button>
          <button
            onClick={() => setSelectedType('almacen')}
            className="flex items-center px-4 py-2 rounded-full border hover:bg-gray-50"
          >
            Almacenes
          </button>
          <button
            onClick={() => setSelectedType('oficina')}
            className="flex items-center px-4 py-2 rounded-full border hover:bg-gray-50"
          >
            Oficinas
          </button>
        </div>
      </div>

      {/* Listings */}
      <div className="max-w-7xl mx-auto px-4 py-8">
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {paginatedSpaces.length > 0 ? (
            paginatedSpaces.map((space) => (
              <SpaceCard
                key={space.id}
                space={space}
                onFavorite={onFavorite}
                isFavorite={space.isFavorite}
                onReserve={onReserve}
              />
            ))
          ) : (
            <p className="col-span-full text-center text-gray-500">
              No se encontraron espacios.
            </p>
          )}
        </div>
      </div>

      {/* Pagination */}
      <div className="flex justify-center mt-6">
        {Array.from({ length: Math.ceil(filteredSpaces.length / itemsPerPage) }, (_, index) => (
          <button
            key={index}
            onClick={() => setCurrentPage(index + 1)}
            className={`mx-1 px-4 py-2 rounded ${
              currentPage === index + 1 ? 'bg-orange-500 text-white' : 'bg-gray-200'
            }`}
          >
            {index + 1}
          </button>
        ))}
      </div>
    </div>
  );
};

export default Home;
